"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[5464],{44364:(t,e,n)=>{n.r(e),n.d(e,{default:()=>o,johnChapter17PL:()=>a});const a={chapter:17,title:"Jean 17",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"To m\xf3wi\u0142 Jezus, a podni\xf3s\u0142szy oczy swoje w niebo, rzek\u0142: Ojcze! przysz\u0142a godzina; uwielb Syna twego, aby i Syn tw\xf3j uwielbi\u0142 ciebie.",strong:[{text:"avoir",strong:"G1372",start:6,end:11},{text:"ciel",strong:"H8064",start:48,end:52},{text:"Fils",strong:"G5207",start:100,end:104},{text:"Fils",strong:"G5207",start:119,end:123}]},{number:2,text:"Jako\u015b mu da\u0142 moc nad wszelkim cia\u0142em, aby wszystkim, kt\xf3re\u015b mu da\u0142, da\u0142 \u017cywot wieczny.",strong:[{text:"selon",strong:"G2531",start:0,end:5},{text:"chair",strong:"G4561",start:44,end:49}]},{number:3,text:"A to\u0107 jest \u017cywot wieczny, aby ci\u0119 poznali samego prawdziwego Boga, i kt\xf3re\u015b pos\u0142a\u0142, Jezusa Chrystusa.",strong:[{text:"seul",strong:"G3439",start:59,end:63},{text:"Dieu",strong:"G2316",start:69,end:73},{text:"Christ",strong:"G5547",start:108,end:114}]},{number:4,text:"Jam ci\u0119 uwielbi\u0142 na ziemi; spraw\u0119 wykona\u0142em, kt\xf3re\u015b mi da\u0142, abym czyni\u0142.",strong:[{text:"terre",strong:"H776",start:24,end:29},{text:"faire",strong:"G1080",start:72,end:77}]},{number:5,text:"A teraz ty mi\u0119 uwielb, Ojcze! u siebie samego t\u0105 chwa\u0142\u0105, kt\xf3r\u0105m mia\u0142 u ciebie, pierwej ni\u017c \u015bwiat by\u0142.",strong:[{text:"monde",strong:"G2889",start:109,end:114}]},{number:6,text:"Objawi\u0142em imi\u0119 twoje ludziom, kt\xf3re\u015b mi da\u0142 z \u015bwiata; twoimi byli, a mnie ich da\u0142e\u015b, i s\u0142owa twego strzegli.",strong:[{text:"monde",strong:"G2889",start:66,end:71},{text:"parole",strong:"G3056",start:136,end:142}]},{number:7,text:"Teraz poznali, \u017ce wszystko, co\u015b mi da\u0142, od ciebie jest.",strong:[{text:"tout",strong:"G3956",start:29,end:33}]},{number:8,text:"Bo s\u0142owa, kt\xf3re\u015b mi da\u0142, da\u0142em im, a oni przyj\u0119li, i poznali prawdziwie, \u017cem od ciebie wyszed\u0142, i uwierzyli, \u017ce\u015b ty mi\u0119 pos\u0142a\u0142.",strong:[]},{number:9,text:"Ja za nimi prosz\u0119; nie prosz\u0119 za \u015bwiatem, ale za tymi, kt\xf3re\u015b mi da\u0142, bo twoi s\u0105.",strong:[{text:"monde",strong:"G2889",start:51,end:56}]},{number:10,text:"A wszystko moje twoje jest, a twoje moje, i uwielbionem jest w nich.",strong:[{text:"tout",strong:"G3956",start:3,end:7}]},{number:11,text:"A ju\u017c ja nie jestem na \u015bwiecie, ale oni s\u0105 na \u015bwiecie, a ja id\u0119 do ciebie. Ojcze \u015bwi\u0119ty! zachowaj je w imieniu twojem, kt\xf3re\u015b mi da\u0142, aby byli jedno, jako i my.",strong:[{text:"dans",strong:"H6887",start:16,end:20},{text:"monde",strong:"G2889",start:24,end:29},{text:"dans",strong:"H6887",start:43,end:47},{text:"monde",strong:"G2889",start:51,end:56},{text:"comme",strong:"G2531",start:152,end:157}]},{number:12,text:"Gdym by\u0142 z nimi na \u015bwiecie, jam je zachowa\u0142 w imieniu twojem; kt\xf3re\u015b mi da\u0142, ustrzeg\u0142em ich, a \u017caden z nich nie zgin\u0105\u0142, tylko on syn zatracenia, aby si\u0119 Pismo wype\u0142ni\u0142o.",strong:[{text:"avec",strong:"G1848",start:16,end:20},{text:"dans",strong:"H6887",start:25,end:29},{text:"monde",strong:"G2889",start:33,end:38},{text:"aucun",strong:"G3762",start:106,end:111},{text:"fils",strong:"G5207",start:143,end:147}]},{number:13,text:"Ale teraz id\u0119 do ciebie, a to m\xf3wi\u0119 na \u015bwiecie, aby mieli rado\u015b\u0107 moj\u0119 zupe\u0142n\u0105 w sobie.",strong:[{text:"dans",strong:"H6887",start:50,end:54},{text:"monde",strong:"G2889",start:58,end:63}]},{number:14,text:"Jam im da\u0142 s\u0142owo twoje, a \u015bwiat je mia\u0142 w nienawi\u015bci, i\u017c nie s\u0105 z \u015bwiata, jako i ja nie jestem z \u015bwiata.",strong:[{text:"parole",strong:"G3056",start:20,end:26},{text:"monde",strong:"G2889",start:34,end:39},{text:"monde",strong:"G2889",start:80,end:85},{text:"comme",strong:"G2531",start:87,end:92},{text:"monde",strong:"G2889",start:115,end:120}]},{number:15,text:"Nie prosz\u0119, aby\u015b je wzi\u0105\u0142 z \u015bwiata, ale aby\u015b je zachowa\u0142 od z\u0142ego.",strong:[{text:"monde",strong:"G2889",start:33,end:38}]},{number:16,text:"Nie s\u0105 z \u015bwiata, jako i ja nie jestem z \u015bwiata.",strong:[{text:"monde",strong:"G2889",start:19,end:24},{text:"comme",strong:"G2531",start:26,end:31},{text:"monde",strong:"G2889",start:54,end:59}]},{number:17,text:"Po\u015bwi\u0119\u0107 je w prawdzie twojej; s\u0142owo twoje jest prawd\u0105.",strong:[{text:"parole",strong:"G3056",start:32,end:38}]},{number:18,text:"Jako\u015b ty mi\u0119 pos\u0142a\u0142 na \u015bwiat, tak i ja pos\u0142a\u0142em je na \u015bwiat.",strong:[{text:"Comme",strong:"G2531",start:0,end:5},{text:"dans",strong:"H6887",start:21,end:25},{text:"monde",strong:"G2889",start:29,end:34},{text:"dans",strong:"H6887",start:60,end:64},{text:"monde",strong:"G2889",start:68,end:73}]},{number:19,text:"A ja za nie po\u015bwi\u0119cam si\u0119 samego, aby i oni byli po\u015bwi\u0119ceni w prawdzie.",strong:[]},{number:20,text:"A nie tylko za temi prosz\u0119, ale i za tymi, kt\xf3rzy przez s\u0142owo ich uwierz\u0105 we mnie;",strong:[{text:"parole",strong:"G3056",start:96,end:102}]},{number:21,text:"Aby wszyscy jedno byli, jako\u015b ty, Ojcze! we mnie, a ja w tobie, aby i oni w nas jedno byli; aby \u015bwiat uwierzy\u0142, \u017ce\u015b ty mi\u0119 pos\u0142a\u0142.",strong:[{text:"comme",strong:"G2531",start:25,end:30},{text:"comme",strong:"G2531",start:59,end:64},{text:"monde",strong:"G2889",start:130,end:135}]},{number:22,text:"A ja chwa\u0142\u0119, kt\xf3r\u0105\u015b mi da\u0142, da\u0142em im, aby byli jedno, jako my jedno jeste\u015bmy.",strong:[{text:"comme",strong:"G2531",start:69,end:74}]},{number:23,text:"Ja w nich, a ty we mnie, aby byli doskonali w jedno, i aby pozna\u0142 \u015bwiat, \u017ce\u015b ty mi\u0119 pos\u0142a\u0142, i umi\u0142owa\u0142e\u015b je, jako\u015b i mi\u0119 umi\u0142owa\u0142.",strong:[{text:"monde",strong:"G2889",start:73,end:78},{text:"comme",strong:"G2531",start:131,end:136}]},{number:24,text:"Ojcze! kt\xf3rych mi da\u0142e\u015b, chc\u0119, aby gdzie ja jestem, i oni byli ze mn\u0105, aby ogl\u0105dali chwa\u0142\u0119 moj\u0119, kt\xf3r\u0105\u015b mi da\u0142; bo\u015b mi\u0119 umi\u0142owa\u0142 przed za\u0142o\u017ceniem \u015bwiata.",strong:[{text:"avec",strong:"G1848",start:69,end:73},{text:"monde",strong:"G2889",start:184,end:189}]},{number:25,text:"Ojcze sprawiedliwy! i \u015bwiat ci\u0119 nie pozna\u0142, alem ja ci\u0119 pozna\u0142, i ci poznali, \u017ce\u015b ty mi\u0119 pos\u0142a\u0142.",strong:[{text:"monde",strong:"G2889",start:15,end:20}]},{number:26,text:"I objawi\u0142em im imi\u0119 twoje, i objawi\u0119, aby mi\u0142o\u015b\u0107, kt\xf3r\u0105\u015b mi\u0119 umi\u0142owa\u0142, w nich by\u0142a, i ja w nich.",strong:[{text:"amour",strong:"G25",start:77,end:82}]}]},o=a}}]);
